from uuid import uuid4from django.db import modelsfrom reserva.models.reserva import Reservaclass Comprobante(models.Model):    id = models.UUIDField(primary_key=True, default=uuid4, editable=False)    codigo_comprobante=models.CharField(max_length=100)    reserva = models.ForeignKey(Reserva,blank=True,null=True)    valor_venta=models.FloatField()    precio_venta = models.FloatField(null=True,blank=True)    igv = models.FloatField(null=True,blank=True)    created_at = models.DateTimeField(auto_now_add=True,null=True,blank=True)    updated_at = models.DateTimeField(auto_now=True,null=True,blank=True)    class Meta:        verbose_name = "Comprobante"        verbose_name_plural = "Comprobantes"    def __str__(self):        return self.valor_venta